import React, { useState } from 'react'

const Logos = () => {

  const [count, setCount] = useState(0)

  function increment() {
      setCount(count +1)
  }

  function decrement() {
      setCount(count-1)
  }


  const list_images = [
    "https://upload.wikimedia.org/wikipedia/commons/thumb/0/0a/Python.svg/2048px-Python.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/2300px-React-icon.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/b/ba/Javascript_badge.svg/1200px-Javascript_badge.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/HTML5_logo_and_wordmark.svg/2048px-HTML5_logo_and_wordmark.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/d/d5/CSS3_logo_and_wordmark.svg/1200px-CSS3_logo_and_wordmark.svg.png",
    "https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Wordpress-Logo.svg/2048px-Wordpress-Logo.svg.png"
  ]
  
  if (count.count >= 0){
    var count1 = count.count
    var count2 = count.count +1
    var count3 = count.count +2
    }
  
  return (
    <div className='studied_images'>
        <img className='first image' src={list_images[count1]}></img>
        <img className='second image' src={list_images[count2]}></img>
        <img className='third image' src={list_images[count3]}></img>
    </div>
  )
}

export default Logos
